// import './CRUD.css';

function CRUD() {
    const list = [
        {
            id:1,
            name:"HP",
            price:"7890"
        },
         {
            id:2,
            name:"lenevo",
            price:"7890"
        },

    ]
    const [lists, setList] = useState(list)
  return (
    <>
    <div className='crud'>
        <table>
            {
                lists.map((current)=>(
                <tr>
                  <td>{current.id} </td>
                  <td> {current.name}  </td>
                  <td>
                    <button>Delete</button>
                  </td>
                </tr>
                 ) )
            }
        </table>
    </div>
    </>
  )
}

export default CRUD
